import React, {Component} from 'react';
import {StyleSheet, TextInput, Text, View, Button} from 'react-native';
import {Card} from 'react-native-elements';

class LoginScreen extends Component {
  signUp: Button;
  signIn: Button;
  render() {
    return (
      <View style={styles.login}>
        <Card containerStyle={styles.loginCard}>
          <Text h1Style={{color: 'white'}}>Let's get these gains!</Text>
          <TextInput>Username</TextInput>
          <TextInput>Password</TextInput>
          <View style={styles.buttonView}>
            <Button style={styles.signUpButton} title="Sign Up">
              Sign Up
            </Button>
            <Button style={styles.signUpButton} title="Sign In">
              Sign In
            </Button>
          </View>
        </Card>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  login: {
    backgroundColor: '#1C2224',
    flex: 1,
  },
  loginCard: {
    width: 366,
    height: 305,
    backgroundColor: '#404A4F',
    justifyContent: 'center',
    borderWidth: 0,
  },
  signUpButton: {
    backgroundColor: '#066da1',
    color: 'white',
    width: 148,
    height: 37.16,
  },
  signInButton: {
    backgroundColor: '#5189a5',
    color: 'white',
    width: 148,
    height: 37.16,
  },
  buttonView: {
    flexDirection: 'row',
  },
});

module.exports = LoginScreen;
